package linear;

import java.util.HashMap;
import java.util.Map;

// https://leetcode.com/problems/replace-the-substring-for-balanced-string/submissions/
public class BalanceString {

    public int balancedString(String s) {
        //int numberofCorrections =0;
        int lengthOfSubString = Integer.MAX_VALUE;

        Map<Character, Integer> mapOfCharacters = new HashMap<Character, Integer>();
        Map<Character, Integer> deltaMaps = new HashMap<Character, Integer>();
        int balancedCount = s.length()/4;

        for(char character : s.toCharArray()) {
            Integer currentCharacterCount = mapOfCharacters.get(character);
            if(currentCharacterCount!=null) {
                mapOfCharacters.put(character,currentCharacterCount + 1);
            } else {
                mapOfCharacters.put(character,1);
            }
        }

        for(Map.Entry<Character, Integer> entry: mapOfCharacters.entrySet()) {
            if(entry.getValue() > balancedCount) {
                deltaMaps.put(entry.getKey(),entry.getValue()-balancedCount);
            }
        }

        for(int index = 0; index < s.length();index ++) {
            //System.out.println("Iteration number:"+index);
            int lengthOfCurrentSubString = 0;
            Map<Character, Integer> deltaMap = new HashMap<Character, Integer>(deltaMaps);
            int secondPointer = index;
            while (!deltaMap.isEmpty()) {
                if(secondPointer < s.length()) {
                    lengthOfCurrentSubString++;
                    Character character = s.charAt(secondPointer);

                    Integer currentCharacterCount = deltaMap.get(character);
                    if(currentCharacterCount!=null) {
                        if((currentCharacterCount - 1) <=0) {
                            deltaMap.remove(character);
                            //System.out.println("Removed '"+character+"' from map. Size is now:"+deltaMap.size());
                        } else {
                            deltaMap.put(character,currentCharacterCount - 1);
                        }
                    }

                    if(deltaMap.isEmpty()) {
                        lengthOfSubString = Math.min(lengthOfCurrentSubString,lengthOfSubString);
                        //System.out.println("Iteration number:"+index);
                        break;
                    }
                    secondPointer++;
                }   else {
                    break;
                }
            }

        }

        System.out.println(lengthOfSubString);
        return lengthOfSubString==Integer.MAX_VALUE?0:lengthOfSubString;
    }

    public static void main(String [] args) {

        //new BalanceString().balancedString("");
        new BalanceString().balancedString("WWEQERQWQWWRWWERQWEQ");
    }
}
